import ascap from "./images/ASCAP.jpeg";
import bmi from "./images/BMI.jpeg";
import gmr from "./images/GMR.jpg";
import sesac from "./images/SESAC.png";
import hfa from "./images/HFA.jpeg";
import "./PROs.css";

const PROs = () => {
  return (
    <div>
      <h2>Meet the PROs</h2>
      <h1>This is where you will find ownership percentages and ISWCs</h1>
      <div className="grid-container">
        <div className="item1">
          <h2>ASCAP</h2>
          <img src={ascap} alt="" />
        </div>
        <div className="item2">
          <h2>BMI</h2>
          <img src={bmi} alt="" />
        </div>

        <div className="item3">
          <h2>GMR</h2>
          <img src={gmr} alt="" />
        </div>
        <div className="item4">
          <h2>SESAC</h2>
          <img src={sesac} alt="" />
        </div>
        <div className="item5">
          <h2>HFA</h2>
          <img src={hfa} alt="" />
        </div>
      </div>
    </div>
  );
};

export default PROs;
